import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { PageOne, getMessage } from './Components/main';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="" element={<PageOne />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
